import './App.css';

function App() {
  return (
    <div>
      <form>
      <input type="text" placeholder="First name"></input>
      <input type="text" placeholder="Last name"></input>
      <input type="text" placeholder="Mobile"></input>
      <input type="date" placeholder="Date of birth"></input>
      </form>
    </div>
  );
}

export default App;
